  const { data } = useFetch({url})

  return (
    <div className="App">
      <div>Hello</div>
      <div>{JSON.stringify(data)}</div>
      <button onClick={() => setUrl('../others/caio.json')}>caio</button>
      <button onClick={() => setUrl('../others/alex.json')}>alex</button>
    </div>
  );
}

